INSERT INTO `coach` VALUES (1, '张教练', '高级驾驶教练', '金牌教练', 'gold', 5, 500, 4.9, 156, '98%', '[\"耐心细致\", \"因材施教\", \"经验丰富\"]', 'data:image/jpeg;base64,', '从事驾驶培训工作5年，具有丰富的教学经验。擅长针对不同学员的特点制定个性化教学方案，深受学员好评。', 1, '2025-10-03 20:51:54', '2025-10-04 21:02:47');
INSERT INTO `coach` VALUES (2, '李教练', '资深驾驶教练', '金牌教练', 'gold', 8, 800, 4.8, 245, '96%', '[\"技术全面\", \"幽默风趣\", \"认真负责\"]', 'data:image/jpeg;base64,', '8年驾驶培训经验，培养学员超过800名。教学方法灵活多样，善于用简单易懂的方式讲解复杂的驾驶技巧。', 1, '2025-10-03 20:51:54', '2025-10-04 22:34:28');
INSERT INTO `coach` VALUES (3, '王教练', '专业驾驶教练', '优秀教练', 'excellent', 6, 600, 4.7, 189, '95%', '[\"方法独特\", \"安全意识\", \"细心指导\"]', 'data:image/jpeg;base64,', '专注驾驶培训6年，注重培养学员的安全驾驶意识和良好的驾驶习惯。教学方法独特，善于发现学员的问题并及时纠正。', 1, '2025-10-03 20:51:54', '2025-10-04 22:34:40');
INSERT INTO `coach` VALUES (4, '刘教练', '高级驾驶教练', '金牌教练', 'gold', 7, 650, 4.9, 203, '97%', '[\"科目二专家\", \"过关率高\", \"专业权威\"]', 'data:image/jpeg;base64,', '专攻科目二培训，对科目二的各项考试项目有深入研究。7年来帮助超过650名学员顺利通过科目二考试。', 1, '2025-10-03 20:51:54', '2025-10-04 22:34:58');
INSERT INTO `coach` VALUES (5, '陈教练', '资深驾驶教练', '优秀教练', 'excellent', 4, 380, 4.6, 128, '95%', '[\"路考专家\", \"实战经验\", \"应试技巧\"]', 'data:image/jpeg;base64,', '专注科目三路考培训，拥有丰富的实际道路教学经验。熟悉各种路况和考试要点。', 1, '2025-10-03 20:51:54', '2025-10-04 22:35:03');
INSERT INTO `coach` VALUES (6, '杨教练', '专业驾驶教练', '优秀教练', 'excellent', 5, 450, 4.7, 142, '95%', '[\"温和友善\", \"循循善诱\", \"服务周到\"]', 'data:image/jpeg;base64,', '性格温和，教学耐心细致。善于与学员沟通，能够根据学员的学习进度调整教学计划。', 1, '2025-10-03 20:51:54', '2025-10-04 22:35:06');
