  `experience` int NOT NULL DEFAULT 0 COMMENT '教学经验（年）',
  `students_count` int NOT NULL DEFAULT 0 COMMENT '培训学员数',
  `rating` decimal(2, 1) NULL DEFAULT 5.0 COMMENT '评分（5分制）',
  `reviews_count` int NULL DEFAULT 0 COMMENT '评价数量',
  `pass_rate` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT '0%' COMMENT '通过率',
  `features` json NULL COMMENT '教学特点标签',
  `avatar` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL COMMENT '头像base64编码',
  `description` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL COMMENT '教练简介',
  `status` tinyint NULL DEFAULT 1 COMMENT '状态：1-在职，0-离职',
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `idx_level`(`level` ASC) USING BTREE,
  INDEX `idx_rating`(`rating` ASC) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 7 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '教练表' ROW_FORMAT = DYNAMIC;

