-- ----------------------------
-- View structure for v_coach_detail
-- ----------------------------
DROP VIEW IF EXISTS `v_coach_detail`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `v_coach_detail` AS select `c`.`id` AS `id`,`c`.`name` AS `name`,`c`.`title` AS `title`,`c`.`badge` AS `badge`,`c`.`level` AS `level`,`c`.`experience` AS `experience`,`c`.`students_count` AS `students_count`,`c`.`rating` AS `rating`,`c`.`reviews_count` AS `reviews_count`,`c`.`pass_rate` AS `pass_rate`,`c`.`features` AS `features`,`c`.`avatar` AS `avatar`,`c`.`description` AS `description`,`c`.`status` AS `status`,`c`.`created_at` AS `created_at`,`c`.`updated_at` AS `updated_at`,group_concat(`s`.`subject_name` order by `s`.`sort_order` ASC separator ',') AS `subjects_name`,group_concat(`s`.`subject_code` order by `s`.`sort_order` ASC separator ',') AS `subjects_code` from ((`coach` `c` left join `coach_subject` `cs` on((`c`.`id` = `cs`.`coach_id`))) left join `subject` `s` on((`cs`.`subject_id` = `s`.`id`))) where (`c`.`status` = 1) group by `c`.`id`;

-- ----------------------------
-- View structure for v_course_detail
-- ----------------------------
DROP VIEW IF EXISTS `v_course_detail`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `v_course_detail` AS select `c`.`id` AS `id`,`c`.`name` AS `name`,`c`.`subject_id` AS `subject_id`,`c`.`type` AS `type`,`c`.`subtitle` AS `subtitle`,`c`.`badge` AS `badge`,`c`.`duration` AS `duration`,`c`.`period` AS `period`,`c`.`features` AS `features`,`c`.`price` AS `price`,`c`.`popular` AS `popular`,`c`.`students_count` AS `students_count`,`c`.`is_combined` AS `is_combined`,`c`.`status` AS `status`,`c`.`created_at` AS `created_at`,`c`.`updated_at` AS `updated_at`,(case when (`c`.`is_combined` = 1) then group_concat(`s`.`subject_name` order by `s`.`sort_order` ASC separator ',') else `s2`.`subject_name` end) AS `subjects_name` from (((`course` `c` left join `course_subject` `cs` on((`c`.`id` = `cs`.`course_id`))) left join `subject` `s` on((`cs`.`subject_id` = `s`.`id`))) left join `subject` `s2` on((`c`.`subject_id` = `s2`.`id`))) where (`c`.`status` = 1) group by `c`.`id`;

-- ----------------------------
-- Event structure for auto_cancel_expired_reservations
-- ----------------------------
DROP EVENT IF EXISTS `auto_cancel_expired_reservations`;
delimiter ;;
CREATE EVENT `auto_cancel_expired_reservations`
ON SCHEDULE
EVERY '1' DAY STARTS '2025-10-08 00:00:00'
DO UPDATE `reservation`
SET `status` = 'cancelled',
    `updated_at` = CURRENT_TIMESTAMP
WHERE `status` = 'upcoming'
  AND `reservation_date` < CURDATE()
;
;;
delimiter ;

SET FOREIGN_KEY_CHECKS = 1;
